@americanadianTO @BryanGlezerson 100%. #LongCovid is devastating &amp; mass disabling. We are just getting started understanding the impact. 

I have friends &amp; clients now on long term disability. I've been fighting the effects of covid for 9 months now.

It's serious.

@DAWysongWrites @BrianEskow Wow, i didn't realize the vaccine did that to the heart. I don't know why they weren't careful to monitor FOR it.
My right arm went numb &amp; that lasted some weeks, eventually recovered, couldn't hold a pen or sign.

Are you ok now? How is it going?
